- input: "TEXT\x1CC00001305\x1C.TEXT\x1C\x1CF3XA\x1CResponse to Commission Letter
    of June 14, 2011, reference the April Monthly Report (03/01/2011- 03/31/2011):
    \ There were 3 transfers-in from non-federal account listed on this report.  The
    first 2 involved Administrative costs and costs associated with the 2011 Reagan
    Event.  The third transfer on 3/28/2011 included the amount of $105.70 for the
    2010 Annual Advance.  This came from disbursement on 3/15 of $175 to Don Mears
    Photography, as listed on Report, which based on reported allocation ratio of
    39.6 Fed to 60.4 Non-fed, equals amount transferred of $105.70.  I went back and
    checked total amounts transferred from non-federal account for this Event, starting
    with the 30 Day Post Election Report, and the total amounts transferred match
    up with the allocation ratio of total expenses.\n"
